webpackJsonp([0xd7f5cf0783b],{403:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Sanjeev Kumar Pandit",subtitle:"#FullStackWebDeveloper",copyright:"© All rights reserved.",author:{name:"Sanjeev Kumar Pandit",twitter:"sanjeevkpandit"},disqusShortname:"sanjeevkpanditcomnp",url:"http://sanjeevkpandit.com.np"}},markdownRemark:{id:"/run/media/sanjeev/Code/Projects/Personal/sanjeevkpandit.github.io/src/pages/articles/2016-05-25---Setup-XDebug-in-PhpStorm/index.md absPath of file >>> MarkdownRemark",html:'<p><a href="https://www.jetbrains.com/phpstorm/" target="_blank">PhpStorm</a> is one of the good IDE for PHP application development available in current era. <a href="https://xdebug.org/" target="_blank">PHP Xdebug</a> is a very strong tool for debugging, making the life easier for <a class="http://www.php.net/" target="_blank">PHP</a> developers to find out the logical mistakes.</p>\n<p>Integration of Xdebug into <a href="https://www.jetbrains.com/phpstorm/" target="_blank">PhpStorm</a> will ease the trouble of debugging for <a class="http://www.php.net/" target="_blank">PHP</a> developers. You can easily setup <a href="https://xdebug.org/" target="_blank">Xdebug</a> in <a href="https://www.jetbrains.com/phpstorm/" target="_blank">PhpStorm</a> by following these steps.</p>\n<h4>Requirements</h4>\n<ul>\n<li><a href="https://www.jetbrains.com/phpstorm/" target="_blank">PhpStorm</a> (get it from <a href="https://www.jetbrains.com/phpstorm/download/" target="\\_blank">here</a>)</li>\n<li><a href="https://xdebug.org/" target="_blank">Xdebug</a> (get it from <a href="https://xdebug.org/download.php" target="_blank">here</a>)</li>\n</ul>\n<h4>Procedures</h4>\n<ul>\n<li>Setup <a href="https://xdebug.org/" target="_blank">Xdebug</a> (if you haven’t done already). Find the steps <a href="{{site.baseurl}}/setup-xdebug-in-ubuntu/" target="_blank">here</a>.\nYou should be able to see <a href="https://xdebug.org/" target="_blank">Xdebug</a> while checking the php version.</li>\n</ul>\n<div class="gatsby-highlight">\n      <pre class="language-shell"><code class="language-shell">$ php --version\nPHP 7.0.7-2+donate.sury.org~xenial+1 <span class="token punctuation">(</span>cli<span class="token punctuation">)</span> <span class="token punctuation">(</span> NTS <span class="token punctuation">)</span>\nCopyright <span class="token punctuation">(</span>c<span class="token punctuation">)</span> 1997-2016 The PHP Group\nZend Engine v3.0.0, Copyright <span class="token punctuation">(</span>c<span class="token punctuation">)</span> 1998-2016 Zend Technologies\n    with Zend OPcache v7.0.6-dev, Copyright <span class="token punctuation">(</span>c<span class="token punctuation">)</span> 1999-2016, by Zend Technologies\n    with Xdebug v2.4.0, Copyright <span class="token punctuation">(</span>c<span class="token punctuation">)</span> 2002-2016, by Derick Rethans</code></pre>\n      </div>\n<ul>\n<li>Now, configure xdebug for debugging. You need to change the <code class="language-text">xdebug.ini</code> file. You can find the location of file using this command using terminal: <code class="language-text">php --ini | grep xdebug</code>.</li>\n</ul>\n<p>Mine returned like this:</p>\n<div class="gatsby-highlight">\n      <pre class="language-shell"><code class="language-shell">$ php --ini <span class="token operator">|</span> <span class="token function">grep</span> xdebug\n/etc/php/7.0/cli/conf.d/20-xdebug.ini,</code></pre>\n      </div>\n<ul>\n<li>Just copy the path of the file and open in your favourite text editor (<a href="https://www.sublimetext.com/" target="_blank">Sublime Text</a> for me). Don’t forget to use <code class="language-text">sudo</code> to edit the file otherwise, you won’t be able to save the changes you make.</li>\n</ul>\n<div class="gatsby-highlight">\n      <pre class="language-shell"><code class="language-shell"><span class="token comment"># for sublime text users</span>\n$ <span class="token function">sudo</span> subl /etc/php/7.0/cli/conf.d/20-xdebug.ini\n\n<span class="token comment"># for gedit users</span>\n$ <span class="token function">sudo</span> gedit /etc/php/7.0/cli/conf.d/20-xdebug.ini\n\n<span class="token comment"># for vim users</span>\n$ <span class="token function">sudo</span> vim /etc/php/7.0/cli/conf.d/20-xdebug.ini\n\n<span class="token comment"># for atom users</span>\n$ <span class="token function">sudo</span> atom /etc/php/7.0/cli/conf.d/20-xdebug.ini</code></pre>\n      </div>\n<ul>\n<li>Add these lines of code at the end of file.</li>\n</ul>\n<div class="gatsby-highlight">\n      <pre class="language-shell"><code class="language-shell">xdebug.remote_enable<span class="token operator">=</span>true\nxdebug.remote_port<span class="token operator">=</span><span class="token string">"9000"</span>   // Port <span class="token keyword">for</span> xdebug. Default is 9000.\nxdebug.profiler_enable<span class="token operator">=</span>1\nxdebug.profiler_output_dir<span class="token operator">=</span><span class="token string">"/tmp"</span></code></pre>\n      </div>\n<ul>\n<li>Time to change things in <a href="https://www.jetbrains.com/phpstorm/" target="_blank">PhpStorm</a>. Navigate to <code class="language-text">File &gt; Settings &gt; Language &amp; Frameworks &gt; PHP</code>. You will see the following screen.</li>\n</ul>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/xdebug-phpstorm-1-56893fac9f2b5721ffc6d9710e1e7219-da6c5.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 960px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 54.133064516129025%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="PhpStorm PHP"\n        title=""\n        src="/static/xdebug-phpstorm-1-56893fac9f2b5721ffc6d9710e1e7219-c83f1.png"\n        srcset="/static/xdebug-phpstorm-1-56893fac9f2b5721ffc6d9710e1e7219-569e3.png 240w,\n/static/xdebug-phpstorm-1-56893fac9f2b5721ffc6d9710e1e7219-93400.png 480w,\n/static/xdebug-phpstorm-1-56893fac9f2b5721ffc6d9710e1e7219-c83f1.png 960w,\n/static/xdebug-phpstorm-1-56893fac9f2b5721ffc6d9710e1e7219-da6c5.png 992w"\n        sizes="(max-width: 960px) 100vw, 960px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Click on the <code class="language-text">...</code> in <code class="language-text">Interpreters</code> option to see more. You will get this:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/xdebug-phpstorm-2-f66fef6bfddfe407d5cc3c19e19dff85-8acc8.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 824px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 43.567961165048544%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="PhpStorm PHP Debugger"\n        title=""\n        src="/static/xdebug-phpstorm-2-f66fef6bfddfe407d5cc3c19e19dff85-8acc8.png"\n        srcset="/static/xdebug-phpstorm-2-f66fef6bfddfe407d5cc3c19e19dff85-a6c71.png 240w,\n/static/xdebug-phpstorm-2-f66fef6bfddfe407d5cc3c19e19dff85-109bf.png 480w,\n/static/xdebug-phpstorm-2-f66fef6bfddfe407d5cc3c19e19dff85-8acc8.png 824w"\n        sizes="(max-width: 824px) 100vw, 824px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>If you are not able to see <code class="language-text">Debugger: Xdebug 2.4.0</code>, try to refresh by clicking the refresh button on the right of <code class="language-text">PHP exectable</code>. Again, if not seen, check the status of <a href="https://xdebug.org/" target="_blank">Xdebug</a> and try again.</p>\n<p>This shows that that <a href="https://xdebug.org/" target="_blank">Xdebug</a> is ready in <a href="https://www.jetbrains.com/phpstorm/" target="_blank">PhpStorm</a>. Save before you exit!</p>\n<ul>\n<li>Now, you need to set up a server. Navaigate to <code class="language-text">File &gt; Settings &gt; Language &amp; Framework &gt; PHP &gt; Servers</code>.</li>\n</ul>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/xdebug-phpstorm-3-516db07cebd31c53cf7290f795052ebd-da6c5.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 960px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 38.810483870967744%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="PhpStorm PHP Servers"\n        title=""\n        src="/static/xdebug-phpstorm-3-516db07cebd31c53cf7290f795052ebd-c83f1.png"\n        srcset="/static/xdebug-phpstorm-3-516db07cebd31c53cf7290f795052ebd-569e3.png 240w,\n/static/xdebug-phpstorm-3-516db07cebd31c53cf7290f795052ebd-93400.png 480w,\n/static/xdebug-phpstorm-3-516db07cebd31c53cf7290f795052ebd-c83f1.png 960w,\n/static/xdebug-phpstorm-3-516db07cebd31c53cf7290f795052ebd-da6c5.png 992w"\n        sizes="(max-width: 960px) 100vw, 960px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Let’s add a server. Click on <span class="dark-green">+</span> icon to add. You will get the same window changed to this:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/xdebug-phpstorm-4-8144ef4c93ebb0f397c33fc77955e96b-da6c5.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 960px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 38.810483870967744%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="PhpStorm PHP Servers - Add new"\n        title=""\n        src="/static/xdebug-phpstorm-4-8144ef4c93ebb0f397c33fc77955e96b-c83f1.png"\n        srcset="/static/xdebug-phpstorm-4-8144ef4c93ebb0f397c33fc77955e96b-569e3.png 240w,\n/static/xdebug-phpstorm-4-8144ef4c93ebb0f397c33fc77955e96b-93400.png 480w,\n/static/xdebug-phpstorm-4-8144ef4c93ebb0f397c33fc77955e96b-c83f1.png 960w,\n/static/xdebug-phpstorm-4-8144ef4c93ebb0f397c33fc77955e96b-da6c5.png 992w"\n        sizes="(max-width: 960px) 100vw, 960px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>By default, it tries to create a unnamed server. Let’s change this to <code class="language-text">TEST_SERVER</code> and fill the other fields as well as shown below.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/xdebug-phpstorm-5-c3afc49c46c2ce0782433d568d6ec4e6-da6c5.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 960px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 38.810483870967744%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="PhpStorm PHP Servers - Test Server"\n        title=""\n        src="/static/xdebug-phpstorm-5-c3afc49c46c2ce0782433d568d6ec4e6-c83f1.png"\n        srcset="/static/xdebug-phpstorm-5-c3afc49c46c2ce0782433d568d6ec4e6-569e3.png 240w,\n/static/xdebug-phpstorm-5-c3afc49c46c2ce0782433d568d6ec4e6-93400.png 480w,\n/static/xdebug-phpstorm-5-c3afc49c46c2ce0782433d568d6ec4e6-c83f1.png 960w,\n/static/xdebug-phpstorm-5-c3afc49c46c2ce0782433d568d6ec4e6-da6c5.png 992w"\n        sizes="(max-width: 960px) 100vw, 960px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Choose <code class="language-text">Xdebug</code> as the <code class="language-text">Debugger</code> option on the right. You can choose different port (default is 80).</p>\n<p>Save before you close the window!</p>\n<ul>\n<li>Now a server is ready, configure debug options. Navigate to <code class="language-text">Run &gt; Edit Configurations</code>.</li>\n</ul>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/xdebug-phpstorm-6-47809c422b282a6f7d6a7cf2d4cdd900-c61d2.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 812px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 47.66009852216749%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="PhpStorm PHP Servers - Configure Debug Options"\n        title=""\n        src="/static/xdebug-phpstorm-6-47809c422b282a6f7d6a7cf2d4cdd900-c61d2.png"\n        srcset="/static/xdebug-phpstorm-6-47809c422b282a6f7d6a7cf2d4cdd900-fa0b5.png 240w,\n/static/xdebug-phpstorm-6-47809c422b282a6f7d6a7cf2d4cdd900-b9d74.png 480w,\n/static/xdebug-phpstorm-6-47809c422b282a6f7d6a7cf2d4cdd900-c61d2.png 812w"\n        sizes="(max-width: 812px) 100vw, 812px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Add new option by clicking on <span class="dark-green">+</span> icon on top left. Choose <code class="language-text">PHP Web Application</code> from number of options.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/xdebug-phpstorm-7-8f835bb9cdaf52b0968321e4ca788ead-c61d2.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 812px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 47.66009852216749%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="PhpStorm PHP Servers - New Configuration"\n        title=""\n        src="/static/xdebug-phpstorm-7-8f835bb9cdaf52b0968321e4ca788ead-c61d2.png"\n        srcset="/static/xdebug-phpstorm-7-8f835bb9cdaf52b0968321e4ca788ead-fa0b5.png 240w,\n/static/xdebug-phpstorm-7-8f835bb9cdaf52b0968321e4ca788ead-b9d74.png 480w,\n/static/xdebug-phpstorm-7-8f835bb9cdaf52b0968321e4ca788ead-c61d2.png 812w"\n        sizes="(max-width: 812px) 100vw, 812px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>You will get a unnamed configuration as shown below.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/xdebug-phpstorm-8-2e6bf16cd262afa95df6ec51460e7363-c61d2.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 812px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 47.66009852216749%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="PhpStorm PHP Servers - PHP Web Application"\n        title=""\n        src="/static/xdebug-phpstorm-8-2e6bf16cd262afa95df6ec51460e7363-c61d2.png"\n        srcset="/static/xdebug-phpstorm-8-2e6bf16cd262afa95df6ec51460e7363-fa0b5.png 240w,\n/static/xdebug-phpstorm-8-2e6bf16cd262afa95df6ec51460e7363-b9d74.png 480w,\n/static/xdebug-phpstorm-8-2e6bf16cd262afa95df6ec51460e7363-c61d2.png 812w"\n        sizes="(max-width: 812px) 100vw, 812px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Set up a configuration for <code class="language-text">TEST_SERVER</code> created earlier. I have named it to <code class="language-text">TEST_CHROME</code>.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/xdebug-phpstorm-9-4984da769c2207b176c0b171c0ee06a3-c61d2.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 812px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 47.66009852216749%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="PhpStorm PHP Servers - New Configuration"\n        title=""\n        src="/static/xdebug-phpstorm-9-4984da769c2207b176c0b171c0ee06a3-c61d2.png"\n        srcset="/static/xdebug-phpstorm-9-4984da769c2207b176c0b171c0ee06a3-fa0b5.png 240w,\n/static/xdebug-phpstorm-9-4984da769c2207b176c0b171c0ee06a3-b9d74.png 480w,\n/static/xdebug-phpstorm-9-4984da769c2207b176c0b171c0ee06a3-c61d2.png 812w"\n        sizes="(max-width: 812px) 100vw, 812px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Choose the created server and appropriate browser availabe from the options. Also, you can see the url that will open in the browser.</p>\n<p>Click on <code class="language-text">OK</code> to save this.</p>\n<ul>\n<li>Now, open the project in <a href="https://www.jetbrains.com/phpstorm/" target="_blank">PhpStorm</a>.</li>\n<li>Set a breakpoint where you want to check your logic. To set a breakpoint, just click on the left side of the line of code. Click on the position of red round mark. Click on th same position to remove the breakpoint.</li>\n</ul>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/xdebug-phpstorm-10-01381f1e3343e9057328fc3f88c95a09-d60f7.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 654px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 12.691131498470948%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABQAAAADCAIAAAAcOLh5AAAACXBIWXMAAAsSAAALEgHS3X78AAAAdklEQVQI12XITQ7CIBBA4Z5F5g9mmGIrKCF15f3PJN01mnx5i7e8e+9ZWt5evm/mmdiQzhIZ4YlxHgPQP8tnDAvQU+lWjvXZba3JDm/D748c67TG5lqFC4QCcLX4XpGZRGPKKflsIJaoFBUiUxJUIRUUviH++AIJ7x345Moq1QAAAABJRU5ErkJggg==\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="PhpStorm PHP Servers - PhpStorm Breakpoint"\n        title=""\n        src="/static/xdebug-phpstorm-10-01381f1e3343e9057328fc3f88c95a09-d60f7.png"\n        srcset="/static/xdebug-phpstorm-10-01381f1e3343e9057328fc3f88c95a09-1b5e2.png 240w,\n/static/xdebug-phpstorm-10-01381f1e3343e9057328fc3f88c95a09-18287.png 480w,\n/static/xdebug-phpstorm-10-01381f1e3343e9057328fc3f88c95a09-d60f7.png 654w"\n        sizes="(max-width: 654px) 100vw, 654px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ul>\n<li>Now open the link in your browser in debugging mode by navigating <code class="language-text">Run &gt; Debug &#39;TEST_CHROME&#39;</code>. The browser may ask you to install a <a href="https://chrome.google.com/webstore/detail/jetbrains-ide-support/hmhgeddbohgjknpmjagkdomcpobmllji" target="_blank">JetBrains Extension (in Chrome)</a> in your browser.</li>\n<li>You will see a webpage opening in the browser you set in configurtion. Navigate to the point where you want to check your logic. When you reach to the breakpoint, the browser will keep itself in the loading position. In the mean time, you will see <a href="https://www.jetbrains.com/phpstorm/" target="_blank">PhpStorm</a> being highlighted in taskbar or focused on top with the breakpoint highlighted with different color as shown below:</li>\n</ul>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/xdebug-phpstorm-11-de5b9e67b73915f01e16018edb2ef217-f31cf.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 960px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 32.84457478005865%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="PhpStorm PHP Servers - PhpStorm Highlighted Breakpoint"\n        title=""\n        src="/static/xdebug-phpstorm-11-de5b9e67b73915f01e16018edb2ef217-c83f1.png"\n        srcset="/static/xdebug-phpstorm-11-de5b9e67b73915f01e16018edb2ef217-569e3.png 240w,\n/static/xdebug-phpstorm-11-de5b9e67b73915f01e16018edb2ef217-93400.png 480w,\n/static/xdebug-phpstorm-11-de5b9e67b73915f01e16018edb2ef217-c83f1.png 960w,\n/static/xdebug-phpstorm-11-de5b9e67b73915f01e16018edb2ef217-f31cf.png 1364w"\n        sizes="(max-width: 960px) 100vw, 960px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>You can see the debugging window right at the bottom part of <a href="https://www.jetbrains.com/phpstorm/" target="_blank">PhpStorm</a> window. You can find <code class="language-text">Step Over</code>, <code class="language-text">Step Into</code>, <code class="language-text">Step Out</code>, <code class="language-text">Watch</code> etc. controls in the Debugging Window.</p>\n<p>See the shortcuts or set up your own shortcuts, they will help you a lot.</p>\n<p>Hope you will feel ease to find any logical mistakes in your PHP code by debugging using <a href="https://xdebug.org/" target="_blank">Xdebug</a> in <a href="https://www.jetbrains.com/phpstorm/" target="_blank">PhpStorm</a>.</p>',fields:{tagSlugs:["/tags/php/","/tags/xdebug/","/tags/php-xdebug/","/tags/phpstorm/"]},frontmatter:{title:"Setup XDebug in PhpStorm",tags:["php","xdebug","php-xdebug","phpstorm"],date:"2016-05-25T00:00:00Z",description:"Debug PHP code in PhpStorm using XDebug."}}},pathContext:{slug:"/posts/setup-xdebug-in-phpstorm/"}}}});
